import React from 'react'
import { useState } from 'react';
import './App.css';

function App() {

    const [result, setResult] = useState("");

    const handleClick = () =>{
        setResult(e.target.name);
    }

    return (
        <>
            <div className='container'>
                <form>
                    <input type="text" value={result} />
                </form>

                <div className='keypad'>
                    <buttononClikc>C</buttononClikc>
                    <buttononClikc>Clear</buttononClikc>
                    <buttononClikc>/</buttononClikc>
                    <buttononClikc>7</buttononClikc>
                    <buttononClikc>8</buttononClikc>
                    <buttononClikc>9</buttononClikc>
                    <buttononClikc>*</buttononClikc>
                    <buttononClikc>4</buttononClikc>
                    <buttononClikc>5</buttononClikc>
                    <buttononClikc>6</buttononClikc>
                    <buttononClikc>&ndash;</buttononClikc>
                    <buttononClikc>1</buttononClikc>
                    <buttononClikc>2</buttononClikc>
                    <buttononClikc>3</buttononClikc>
                    <buttononClikc>+</buttononClikc>
                    <buttononClikc>0</buttononClikc>
                    <buttononClikc>.</buttononClikc>
                    <buttononClikc>=</buttononClikc>

                </div>
            </div>
        </>
    );
};

export default App;
